import "./login.scss"

export default function Login() {
    return(
        <div className="background-img">
            <div className="login">
                <img src="/assets/posters/bingeboxlogo.svg" className="logo" />
            </div>
            <form >
                <input type="text" />
            </form>
        </div>
    )
}
